Wrestler, The (2008)  

Verenigde Staten / Frankrijk
Drama
115 minuten

geregisseerd door Darren Aronofsky
met Mickey Rourke, Marisa Tomei en Evan Rachel Wood

In de jaren '80 was Randy &quot;The Ram&quot; Robinson een beroemd professioneel worstelaar. Nu, twintig jaar later, moet hij het doen met een handjevol liefhebbers bij shows in gymzalen en buurthuizen. Tegen alle verwachtingen werkt hij aan een comeback om opnieuw de held te zijn op de enige plek die hij als zijn thuis beschouwt: de ring.


